description:
While Bill's sister goes off to run errands, she lets her friend Jessica stay at the house. Jessica conveniently finds her way up to Bill's room because she is intrigued by the consensus of the town they live in that Bill is a guy to stay away from. After trying to feed her curiosity, Bill thanks Jessica for her interests and tells her she better run along before she gets herself into some trouble. She says it's trouble she's looking for but, Jessica will settle for a big dick in her mouth!


